import React, { PureComponent } from 'react';
import { BarChart, Bar, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

const data = [
  {
    name: 'Page A', value: 'Beginner'
  },
  {
    name: 'Page B', value: 'Expert'
  },
  {
    name: 'Page C', value: 'Intermediate'
  },
  {
    name: 'Page D', value: 'Advanced'
  },
  {
    name: 'Page E', value: 'Elementary'
  }
];

const renderCustomAxisTick = ({x, y, payload}) => {
  let path = '';

  switch (payload.value) {
    case 'Page A':
      path = 'Expert'
      break;
    default: 
      path = '';
  }
}

class Example extends PureComponent {
  render() {
    return (
      <div> 
        <BarChart
          width={500}
          height={500}
          data={data}
          layout="vertical"
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis type="category" interval={0} tick={renderCustomAxisTick}/>
          <YAxis type="category" dataKey="name" />
          <Tooltip />
          <Legend />
          <Bar dataKey="value" fill="#8884d8" />
        </BarChart>
      </div>
    );
  }
}

export default Example
